'''Molanisks''' are [[Slayer monsters]] that require level 39 [[Slayer]] to kill giving 52 Slayer [[experience]] per kill. A [[Slayer bell]] is necessary to fight them. Players should remember to bring a [[Light sources|light source]] when fighting them, as they are only found underground. Despite what their level would suggest, Molanisks do unusually low damage, meaning a relatively mid-level player with half-decent [[armour]] should easily be able to kill several of them.

