==Strategy==
[[File:Molanisk hiding.png|thumb|170px|left|A molanisk disguised on a wall.]]
Molanisks are found attached to cave walls and must be lured off with a [[Slayer bell]] to allow players to attack them. When lured off the wall, they are [[Aggressiveness|aggressive]] towards the player who lured them off with the bell. Molanisks [[Spawning|respawn]] relatively quickly, so players who want to conserve [[Energy|run energy]] can just stay at the same respawn location. Bringing a [[stamina potion]] allows for a quicker task.

Molanisks have a low maximum hit and their attacks aren't very accurate, however their hits can mount up. Therefore, a small amount of [[food]] is recommended up to [[Defence]] level 80 for larger tasks (over 100). An alternative would be picking up [[bones]] and using the [[Bones to Bananas]] or [[Bones to Peaches]] spell. Due to their maximum hit being so low, level 40 Defence and [[Adamant equipment#Armour|adamant]] or [[Rune equipment#Armour|rune armour]] is sufficient.

Molanisks are relatively weak to both [[Crush weapons|crush]] and [[magic]] attacks.

Molanisks can only be [[safespot]]ted on certain rocks, notably the large one down the path south of the [[Fairy rings|fairy ring]].

If you are getting attacked by another monster, for example a [[Cave Crawler]], and then use the Slayer bell, the Molanisk will attack you and the monster initially attacking you will lose its aggression.
[[File:Molanisk safespot.png|thumb|300px|A [[safespot]] for molanisks.]]

